int main() {
	const auto W{ 7 };
	const auto K{ 11 };
	int tablica[W][K];		// stworzenie tablicy dwuwymiarowej o wymiarach WxK

	srand(time(nullptr));
	// wype≈Çnienie tablicy:
	auto parzyste{ 0 };
	for (auto i{ 0 }; i < W; ++i) {
		for (auto j{ 0 }; j < K; ++j) {
			tablica[i][j] = 1 + rand() % 30;
			cout << tablica[i][j] << '\t';
			if (tablica[i][j] % 2 == 0) {
				++parzyste;
			}
		}
		cout << endl;
	}
	cout << "W tablicy znajduje sie " << parzyste << " parzystych liczb.\n";

	return 0;
}

