import os
import platform
import random


class GuessGame:
    def __init__(self):
        self.counter = 6
        self.original_place = random.randint(1, 54)
        self.current_place = self.original_place

    def clear_screen(self):
        """–û—á–∏—â–∞–µ—Ç –∫–æ–Ω—Å–æ–ª—å –≤ –∑–∞–≤–∏—Å–∏–º–æ—Å—Ç–∏ –æ—Ç –æ–ø–µ—Ä–∞—Ü–∏–æ–Ω–Ω–æ–π —Å–∏—Å—Ç–µ–º—ã."""
        os_type = platform.system()
        if os_type == "Windows":
            os.system('cls')
        else:
            os.system('clear')

    def _validate_input(self, number, index_char):
        """–ü—Ä–æ–≤–µ—Ä—è–µ—Ç –∫–æ—Ä—Ä–µ–∫—Ç–Ω–æ—Å—Ç—å –≤–≤–æ–¥–∞ –ø–æ–ª—å–∑–æ–≤–∞—Ç–µ–ª—è."""
        if number < -54 or number > 54:
            return False
        if self.counter <= 1:
            return False
        return True

    def make_guess(self, number, index_char):
        """–û–±—Ä–∞–±–∞—Ç—ã–≤–∞–µ—Ç –ø–æ–ø—ã—Ç–∫—É —É–≥–∞–¥—ã–≤–∞–Ω–∏—è –ø–æ–ª—å–∑–æ–≤–∞—Ç–µ–ª—è."""
        if not self._validate_input(number, index_char):
            return self.counter, "WA"

        self.counter -= 1

        if index_char == '!':
            return (self.counter, "OK") if number == self.original_place else (self.counter, "WA")
        elif index_char == '?':
            self.current_place += number
            if 1 <= self.current_place <= 54:
                char_string = "low" if self.current_place % 2 != 0 else "high"
                char_string += " side" if self.current_place >= 37 else " main"
                return self.counter, char_string
            else:
                return self.counter, "WA"

    def play(self):
        """–ó–∞–ø—É—Å–∫–∞–µ—Ç –∏–≥—Ä–æ–≤–æ–π –ø—Ä–æ—Ü–µ—Å—Å."""
        status = ""
        while self.counter > 0 and status not in ["OK", "WA"]:
            print(f"–ë—ã–ª–æ –∑–∞–≥–∞–¥–∞–Ω–æ —á–∏—Å–ª–æ: {self.original_place}") # –°—Ç—Ä–æ–∫–∞ –¥–ª—è —Ç–µ—Å—Ç–∏—Ä–æ–≤–∞–Ω–∏—è
            print(f"–¢–µ–∫—É—â–µ–µ –º–µ—Å—Ç–æ: {self.current_place}") # –°—Ç—Ä–æ–∫–∞ –¥–ª—è —Ç–µ—Å—Ç–∏—Ä–æ–≤–∞–Ω–∏—è
            print(f"–£ –≤–∞—Å –æ—Å—Ç–∞–ª–æ—Å—å {self.counter} –ø–æ–ø—ã—Ç–æ–∫")
            try:
                a = input("–í–≤–µ–¥–∏—Ç–µ —Å–∏–º–≤–æ–ª ('!' –∏–ª–∏ '?'): ")
                b = int(input("–í–≤–µ–¥–∏—Ç–µ —á–∏—Å–ª–æ: "))
            except ValueError:
                print("–ù–µ–∫–æ—Ä—Ä–µ–∫—Ç–Ω—ã–π –≤–≤–æ–¥. –ü–æ–ø—Ä–æ–±—É–π—Ç–µ —Å–Ω–æ–≤–∞.")
                continue

            _, status = self.make_guess(b, a)
            print(f"–û—Ç–≤–µ—Ç —Å–µ—Ä–≤–µ—Ä–∞: {status}")
            input("–ù–∞–∂–º–∏—Ç–µ Enter, —á—Ç–æ–±—ã –ø—Ä–æ–¥–æ–ª–∂–∏—Ç—å...")
            self.clear_screen()


if __name__ == "__main__":
    game = GuessGame()
    game.play()

